import React from 'react'
import Room from './Rooms';

export default function RoomsList({rooms}) {
    console.log(rooms)
    return (
        <section className="roomslist">
            {rooms.map(item =>{
                return <div className="roomslist-center"><Room rooms={item} key={item.id}></Room> </div>
            })}
        </section>
    )
}
